window.bookSummaryJSON = "<p>Knowledge is power. That would be the motto of Lander University, had it not been snatched up and used to death by others long before the school was founded. For while Lander offers a full range of courses to nearly all students, it also offers a small number of specialty classes to a very select few.&nbsp;</p> <p>Lander is home to the Hero Certification Program, a curriculum designed to develop student with superhuman capabilities, commonly known as Supers, into official Heroes. Five of this year’s freshmen are extra special. They have a secret aside from their abilities, one that they must guard from even their classmates. Because for every one person in the world with abilities they can control, there are three who lack such skill. These lesser super beings, Powereds as they are called, have always been treated as burdens and second class citizens. Though there has been ample research in the area, no one has ever succeeded in turning a Powered into a regular human, let alone a Super.&nbsp;&nbsp;&nbsp;&nbsp;</p> <p>That is, until no....…&nbsp;&nbsp;&nbsp;</p> <p>Performed by Jonathan Lee Taylor, Darius Johnson, Alejandro Ruiz, Rana Kay, Megan Poppy, John Kielty, Zeke Alton, Yasmin Tuazon, James J. Johnson, James Konicek, Kay Eluvian, Jacob Yeh, Chris Stinson, Michael John Casey, Matthew Schleigh, Lise Bruneau, Matthew Bassett, Matthew Pauli, Emlyn McFarland, Jessica Lauren Ball, Henry Kramer, Steven Carpenter, Carolyn Kashner, Colleen Delany, Bianca Bryan, Rick Rohan, James Lewis, Scott McCormick, Joel David Santner, Delores King Williams, Nora Achrati and Nanette Savard.\"</p>"; 
